                    "biography": "Asumo el arte como una reinterpretación de la realidad generadora de cuestionamientos en un contexto, que incide directamente en las  estructuras de la actividad artística individual.\r\n\r\nMi intención es reconfigurar los significantes artísticos a través de la exploración de medios y materiales diversos indagando en sus potencialidades semánticas. Tengo una inclinación especial por los medios digitales, tanto por sus potencialidades estéticas como por su capacidad de cuestionar y comunicar.\r\n\r\nAsimismo, desde hace varios años indago en el arte sonoro, a partir de mi experiencia musical como vocalista en diferentes bandas. Esto me ha llevado a analizar el sonido, no solamente como una experiencia auditiva, sino también como una acción física, que se puede representar de una forma tangible a través de diferentes medios. El participar en proyectos de tipo paisaje sonoro me ayudaron a reconocer formas alternativas de crear  cartografías (mapa sonoro) sobre una cultura o contexto específico, presentándolos en su forma natural o reinterpretándolos para crear nuevos planteamientos en diálogo con los discursos originales.\r\n\r\nActualmente me encuentro cursando el segundo año en la especialidad de Pintura de la Ensabap (Escuela Nacional Superior Autónoma de Bellas Artes).\r\n",
