                    "photo": "//res.cloudinary.com/arte-manifiesto/image/upload/w_150,h_150,d_avatar_default.jpg/avatars/avatar_aantononio",
                    "country": "IT",
                    "city": "Torino",
                    "biography": "Somos testigos hoy en día de que, en el medio artístico, todo puede ser poesía - o, según un contexto predeterminado - en lo cotidiano, todo puede ser arte. En todo caso, la crítica o algunos artistas contemporáneos parecen creer que la pintura, o la técnica en general, son medios anacronistas: en el sentido que carecen de la libertad y del alcance que proporciona el arte conceptual en todas sus formas. \r\nYo, por mi parte, en cuanto estudiante de arte y artista contemporáneo, pienso que la pintura hoy en día, abre más puertas de las que cierra. Así quisiera estudiarla y ponerla en práctica: aprovechando la libertad del “Hoy” para comunicar a través del arte. \r\nAsimismo, creo firmemente que una obra artística gana muchísimo cuando habla por sí sola... o cuando “sugiere” por sí sola. Ahí radican la función comunicativa del arte y toda su poesía. He ahí su gran alcance: Qué despierta el arte en el espectador? Para qué una acotación de tres páginas y un documental sobre un proyecto artístico? No sería más práctico que éste puediese por sí mismo, evocar o mover algo en quien observa? No expandiría, así el arte, su rango de repercusión? \r\n\r\n",
