                    "biography": "Nacido en Lima -Peru\r\n\r\nTrato de mostrar mi visión de la realidad, mostrando imágenes sin orlas, mi espacio preferido es el papel, tan antigua herramienta y casi fundamental arma para una buena ilustración ,  trabajo con el claro oscuro, luz y sombra dualidad eterna que me acompaña. Siempre en constante aprendizaje ,soy autodidacta .\r\n\r\nBusco la exactitud en los detalles,  y trato de crear un sentido ludico entre el titulo y el icono.\r\n\r\nMi búsqueda de dominar el material de trabajo, el espacio donde recreo las fotografías trazo por trazo y que hablen por si solas, quizás en mis obras muestro introspección.\r\n\r\nMi escudo es un papel, mi arma un lápiz.\r\n\r\n\r\n\r\n",
