                    "biography": "Empecé a pintar después de ver que , de mis dibujos en hojas de notas, salían formas concretas que podrían convertirse en pinturas . En mi trabajo trato de expresar mis sentimientos , y hacer feliz a la gente con un sentimiento de optimismo y de paz con los colores y la luz que pinto. Soy autodidacta. Siempre pinto con pinceles . Me gusta la sensación de ligereza que transmiten cuando deslizo la pintura sobre el lienzo . Prefiero la pintura al óleo por su brillo, color y volumen. Cuando veo que el resultado final se asemeja a lo que trato de mostrar,y   veo que gusta a otras personas me siento muy feliz. Mi color favorito es el azul del Mediterráneo y su luz,la cual trato de dar mi trabajo.   Siempre sigo el mismo procedimiento para pintar un cuadro. En mi mente veo una imagen que más tarde trato de pintar, y, normalmente el resultado se asemeja bastante a la primera visión que he tenido.\r\n\r\nEsteve",
