                    "country": "PE",
                    "city": "Lima",
                    "biography": "Artista visual peruana, vive y trabaja entre Lima y São Paulo. Egresada de la Facultad de Arte de la Pontificia Universidad Católica del Perú. Durante los últimos años ha sido docente para el Instituto San Ignacio de Loyola, Pontificia Universidad Católica del Perú y la Universidad Pontificia Bolivariana de Medellín. \r\nDesarrolla proyectos e investigaciones artísticas relacionados a los conceptos de territorio, identidad y urbe. Ha participado en diversas exposiciones individuales y colectivas tanto en el Perú (Lima, Arequipa, Cusco, entre otras) como a nivel internacional en distintas ciudades de Brasil, Chile, Bolivia, Colombia, Francia, Estados Unidos, etc. Siendo las más resaltantes: “Lima 478” Museo Metropolitano de Lima (Lima, Perú), “Aberto para Re-Forma” Casa Contemporânea (São Paulo, Brasil), “Mão da América” Galería Marta Traba del Memorial de America Latina (São Paulo, Brasil). \r\n\r\nSu trabajo se ha expuesto en la VII Bienal Internacional de Arte de Suba (Bogotá, Colombia) y en la III Bienal Internacional de Grabado del Instituto Cultural Peruano Norteamericano (Lima, Perú) así como dentro del marco de la 29a Bienal de São Paulo.\r\n\r\nEs fundadora y CEO de ICONOGRAFICO, empresa acelerada por Wayra en el que los dibujos de las culturas del Perú se reinterpretan en el diseño contemporáneo. ( facebook.com/IconograficoPeru )\r\n\r\nEs parte del colectivo Posiciones de Emergencia (Lima + Bogotá), colabora en proyectos de desarrollo desde el arte y el diseño con el grupo AXIS-Arte y es miembro del Instituto Riva-Agüero para el Seminario de Arte y Cultura Popular.\r\n\r\nEs representada en São Paulo por la Galería Canvas SP.",
