                    "country": "PE",
                    "city": "Lima",
                    "biography": "Actualmente yo resido en la ciudad de Lima, Perú.\r\n\r\nAl principio, mi deseo era estudiar pintura, pero con el tiempo empecé a interesarme por el Diseño Gráfico y decidí continuar con el estudio de esta profesión. Estudié la carrera de diseño gráfico en la Escuela Superior de Artes Gráficas Orval, y que ahora es la Universidad Peruana de Arte Orval.\r\n\r\nAl terminar mis estudios en la Escuela de Diseño, obtuve el título de Director de Artes Gráficas Publicitarias, esto me permitió después trabajar en varias empresas relacionadas al campo del diseño en mi país.\r\n\r\nMi labor en los centros de fotografía profesional también me llevó al mundo de la fotografía. Después de eso comencé con mi trabajo artístico el cual sigo desarrollando actualmente. Este se inspira sobre todo en mis inicios y mi amor por la pintura, de alguna manera se mezcla un poco con mi actividad en el diseño gráfico. \r\n\r\nDespués de un tiempo de elaborar varios de estos trabajos, finalmente muchos de ellos han sido publicados en varias páginas de diseño y de arte en varios países.\r\n\r\nEstuve participando en publicaciones de Revistas de diseño y arte como Hangar A4, Practical Photoshop, etc, ademas de ser incluido dentro de la galería de Artistas del Photoshop del mundo. El año pasado, fui invitado por la Universidad Peruana de Arte Orval para desarrollar la enseñanza del curso sobre manipulación fotográfica y retoque digital, lo cual me ha permitido iniciar mi actividad como docente dentro de la institución. \r\n\r\nActualmente estoy realizando mis estudios para obtener la licenciatura en Educación Artística, a fin de continuar con la enseñanza en las aulas. ",
