                    "biography": "\\\"Annabelle es una artista-fotógrafa francesa que vive en Perú desde 2003. En Cusco, la capital imperial Inca, Annabelle descubre su pasión por la obra de Carlos Nishiyama, uno de los más grandes nombres de la fotografía peruana y profundo conocedor de los rituales andinos.  A su lado, como estudiante, Annabelle desarrolla su propia mirada hacia el mundo, más allá de los parámetros técnicos: “Sentir y fotografiar la belleza de la gente en lo más profundo de su alma y a través de escenas de la vida que muestran su lado más auténtico”. En América Latina, para esta mujer discreta que se siente más cómoda en el terreno que en la vida en sociedad, el material está ahí, cada día, delante de sus ojos. Desde 2006, su trabajo como “fixer” (coordinadora de producción) en docenas de documentales para televisiones europeas, le ha permitido viajar por todo Perú y Bolivia llegando con su cámara hasta lugares remotos y llenos de vida. Una bendición para poder satisfacer su pasión por la fotografía, que también alimenta en otras muchas oportunidades a través de viajes personales y profesionales.\\\" Stephane Jussiere ",
